import React from 'react';
import './folder.css';
import {useSelector} from "react-redux";
import {AppStateType} from "../../Redux/Redux-store";
import {useHistory} from "react-router-dom";
import FolderInfo from "./folderInfo";

const Folder = () => {
    const cars = useSelector((state: AppStateType) => state.folderPage.ArrayFolders);
    const history =useHistory();
    const nextPage  = (id:string | number) =>{
        history.push(`/folder/${id}`);
    }
    return (
        <div>
            {
                cars.map(m => {
                    return (<div className='Block_Wrapper'>
                            <div className='Block_content' onClick={() => nextPage(m.folderId)}>
                                {
                                    m.Cars.map(m1 => {
                                        return m1.id
                                    })
                                }
                            </div>
                            <div>{m.nameOfFolder}</div>
                        </div>
                    )
                })
            }
        </div>
    );
};

export default Folder;
